Push model with new property to MongoDB<p>I have a simple script that counts the number of documents of a particular user and assigns it to <code>externalUser.totalIcons</code> and after that saves this model to the database (MongoDB).</p>
<p>But when I'm trying to run it, it does not save the model and does not add a new property to the database.</p>
<p>Question: where I messed up something and what workaround can I apply here to see that script updated it in the database?</p>
<pre><code>import { Icon, User } from '../../models'
import { runScript } from '../utils'

export async function run () {
  const userCriteria = { isExternal: true }
  const iconCriteria = { 'icons.source': 'external' }
  const externalUsers = await User.find(userCriteria)

for (const externalUser of externalUsers) {
    externalUser.totalIcons = await Icon.countDocuments({
      ...iconCriteria,
      'icons.userId': externalUser._id
    })
    console.log(externalUser._id + ' has: ' + externalUser.totalIcons)
    await externalUser.save()
  }
}

if (require.main === module) {
  runScript('totalIconsFieldUpdate', run)
}

</code></pre>

