<pre><code>db.categories.aggregate(
  {
    $lookup:{
        from:&quot;products&quot;,
        localField:&quot;_id&quot;,
        foreignField:&quot;product_category&quot;,
        as:&quot;category_products&quot;
     }
   }
)
</code></pre>
<p>and I receive this as a result:</p>
<pre><code>{ _id: ObjectId(&quot;613cde06e806c050fcf073eb&quot;),
  name: 'Drinks',
  category_products: 
