<pre><code>module.exports.getUserByQuery = function (params, callback) {
  if (params.nationality.length !== 0 &amp;&amp; params.languages.length !== 0) {
    User.find(
      {
        age: {
          $gt: params.minAge,
          $lt: params.maxAge,
        },
        nationality: { $in: paramas.nationality},
        languages: { $in: params.languages },
      },
      callback
    );
  } else if (params.nationality.length === 0 &amp;&amp; params.languages.length === 0) {
    User.find(
      {
        age: {
          $gt: params.minAge,
          $lt: params.maxAge,
        },
      },
      callback
    );
  } else if (params.nationality.length !== 0 &amp;&amp; params.languages.length === 0) {
    User.find(
      {
        age: {
          $gt: params.minAge,
          $lt: params.maxAge,
        },
        nationality: { $in: params.nationality },
      },
      callback
    );
  } else if (params.nationality.length === 0 &amp;&amp; params.languages.length !== 0) {
    User.find(
      {
        age: {
          $gt: params.minAge,
          $lt: params.maxAge,
        },
        languages: { $in: params.languages },
      },
