MongoDB does not save without Express server restart<p>I am developing a questionnaire in MERN stack - one question per page (e.g. &quot;Specify name&quot; on one page, click next question, &quot;Specify company name&quot; on another page etc.), about 40 pages.</p>
<p>When clicking &quot;Next&quot; the app saves user's answer in the localStorage, retrieves from localStorage and sends an axios.post to express server, which finds a MongoDB document by uuid and updates it with a new answer.</p>
<p>The problem is that not all answers are saved in the MongoDB. After some questions the answers stop saving to MongoDB. Only when I restart the express server and try again to answer the question, then it saves it to MongoDB.</p>
<p>I have no idea what's wrong. Any suggestions are welcome</p>
<p><strong>Here is a code example:</strong></p>
<pre><code>//React:
import { useState } from &quot;react&quot;;
import axios from &quot;axios&quot;;
import { useHistory } from &quot;react-router-dom&quot;;
import NextQuestion from &quot;./NextQuestion&quot;;

export default function Question1() {
  const history = useHistory();
  const [input, setInput] = useState(&quot;&quot;);

  function handleChange(e) {
    setInput(e.target.value);
  }

  function handleSubmit(e) {
    e.preventDefault();
    localStorage.setItem(&quot;name&quot;, input);

    const data = {
      uuid: localStorage.getItem(&quot;uuid&quot;),
      name: localStorage.getItem(&quot;name&quot;),
    };

    axios.post(&quot;/answers&quot;, data);

    history.push(&quot;/next-question&quot;);
  }

  return (
    &lt;BrowserRouter&gt;
      &lt;Route path=&quot;/question-1&quot;&gt;
        &lt;form&gt;
          &lt;input id=&quot;name&quot; type=&quot;text&quot; value={value} onChange={handleChange} /&gt;
          &lt;label for=&quot;#name&quot;&gt;Please specify your name&lt;/label&gt;
          &lt;button onClick={handleSubmit}&gt;NEXT QUESTION&lt;/button&gt;
        &lt;/form&gt;
      &lt;/Route&gt;
      &lt;Switch&gt;
        &lt;Route path=&quot;/next-question&quot;&gt;
          &lt;NextQuestion /&gt;
        &lt;/Route&gt;
      &lt;/Switch&gt;
    &lt;/BrowserRouter&gt;
  );
}

//Express server:
require(&quot;dotenv&quot;).config();
const express = require(&quot;express&quot;);
const app = express();
const cors = require(&quot;cors&quot;);
const mongoose = require(&quot;mongoose&quot;);

app.use(express.json());
app.use(cors());

mongoose.connect(process.env.MONGO_URI);

const answerSchema = {
  uuid: String,
  name: String,
  company: String,
  title: String,
  email: String,
  phone: String,
};

const Answer = mongoose.model(&quot;Answer&quot;, answerSchema);

app.post(&quot;/answers&quot;, (req, res) =&gt; {
  if (req.body.uuid) {
    Answer.updateOne(
      { uuid: req.body.uuid },
      {
        name: req.body.name,
        company: req.body.company,
        title: req.body.title,
        email: req.body.email,
        phone: req.body.phone,
      },
      {
        upsert: true,
      }
    )
      .then((item) =&gt; console.log(item))
      .catch((err) =&gt; res.status(400).json(&quot;Error &quot; + err));
  } else {
    const newAnswer = new Answer({
      uuid: req.body.uuid,
      name: req.body.name,
      company: req.body.company,
      title: req.body.title,
      email: req.body.email,
      phone: req.body.phone,
    });

    newAnswer
      .save()
      .then((item) =&gt; console.log(item))
      .catch((err) =&gt; res.status(400).json(&quot;Error &quot; + err));
  }
});

app.listen(3001, function () {
  console.log(&quot;Express is running&quot;);
});
</code></pre>

