embedfield:
mongoose schema transform not invoked if document is returned directly from query<p>I have an endpoint that does an operation such as this:</p>
<pre><code>        const pipeline = [
          {
            $match: {
              $and: [
                {
                  $or: [...],
                },
              ],
            },
          },
          {
            $group: {
              _id : '$someProp',
              anotherProp: { $push: '$$ROOT' },
            },
          },
          { $sort: { date: -1 } },
          { $limit: 10 },
        ]
        const groupedDocs = await MyModel.aggregate(pipeline);
</code></pre>
<p>The idea here is that the returned documents look like this:</p>
<pre><code>[
  {
    _id: 'some value',
    anotherProp: [ /* ... array of documents where &quot;someProp&quot; === &quot;some value&quot; */ ],
  },
  {
    _id: 'another value',
    anotherProp: [ /* ... array of documents where &quot;someProp&quot; === &quot;another value&quot; */ ],
  },
  ...
]
</code></pre>
<p>After getting these results, the endpoint responds with an array containing all the members of <code>anotherProp</code>, like this:</p>
<pre><code>const response = groupedDocs.reduce((docs, group) =&gt; docs.concat(group.anotherProp), []);
res.status(200).json(response);
</code></pre>
<p>My problem is that the final documents in the response contain the <code>_id</code> field, but I want to rename that field to <code>id</code>. <a href="https://stackoverflow.com/questions/7034848/mongodb-output-id-instead-of-id">This question</a> addresses this issue, and specifically <a href="https://stackoverflow.com/a/42763286/7987987">this answer</a> is what <em>should</em> work, but for some reason the transform function doesn't get invoked. To put it differently, I've tried doing this:</p>
<pre><code>schema.set('toJSON', {
    virtuals: true,
    transform: function (doc, ret) {
        console.log(`transforming toJSON for document ${doc._id}`);
        delete ret._id;
    },
});
schema.set('toObject', {
    virtuals: true,
    transform: function (doc, ret) {
        console.log(`transforming toObject for document ${doc._id}`);
        delete ret._id;
    },
});
</code></pre>
<p>But the <code>console.log</code> statements are not executed, meaning that the transform function is not getting invoked. So I still get the <code>_id</code> in the response instead of <code>id</code>.</p>
<p>So my question is <strong>how can I get <code>id</code> instead of <code>_id</code> in this scenario?</strong></p>
<p>Worth mentioning that <code>toJSON</code> and <code>toObject</code> are invoked (the <code>console.log</code>s show) in other places where I read properties from the documents. Like if I do:</p>
<pre><code>const doc = await MyModel.findById('someId');
const name = doc.name;
res.status(200).json(doc);
