<pre><code>const express = require('express');
const cors = require('cors');
const mongoose = require('mongoose');

require('dotenv').config();


const app = express();
const port = process.env.PORT || 5000;

app.use(cors);
app.use(express.json());

const uri = process.env.ATLAS_URI;
mongoose.connect(uri, { useNewUrlParser:true });

const connection = mongoose.connection;
connection.once('open', () =&gt;{
    console.log(&quot;MongoDB database connection established succesfully&quot;)
})

const usersRouter = require('./routes/users');
app.use('/users', usersRouter); 

app.listen(port, () =&gt; {
    console.log(`Server is running on port: ${port}`);
});
</code></pre>
<p>Now, here is the code of the users router file, into i put the code:</p>
<pre><code>const router = require('express').Router();//setting it as a express router
let User = require('../models/user.model');//requise the model created before

router.route('/').get((req, res) =&gt; {
  User.find()//mongoose method, returns a promise
    .then(users =&gt; res.json(users))//return the list of user
    .catch(err =&gt; res.status(400).json('Error: ' + err));
});

router.route('/add').post((req, res) =&gt; {
  const username = req.body.username;

  const newUser = new User({username});

  newUser.save()
    .then(() =&gt; res.json('User added!'))
    .catch(err =&gt; res.status(400).json('Error: ' + err));
});

module.exports = router;
</code></pre>
